import React from "react";

const Navbar = () => {
  return (
    <div className="container">
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
  <a className="navbar-brand" href="#">Market<span className="p-3 mb-2 bg-primary text-white">Circle</span></a>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon"></span>
  </button>
  <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
    <div className="navbar-nav justify-content-center">
    <a className="nav-link" href="#">Market</a>
      <a className="nav-link" href="#">Jobs</a>
      <a className="nav-link" href="#">Partnership</a>
      <a className="nav-link" href="#">Forum</a>
      <a className="nav-link active" href="/job/blog">Blog <span className="sr-only">(current)</span></a>
    </div>
  </div>
</nav>
</div>
  );
};

export default Navbar;
